import React from "react";
import { Element } from "react-scroll";
import "./ContactContainer.css";

const ContactContainer = () => {
  return (
    <div>
      <Element name="Contact" className="contactcontainer">
        <h1>Contact Us</h1>
        <p>Tech Club <img src="../../Images/"/></p>
        <p>
          <bold>Addr:</bold> Annamalai University,Annamalai Nagar,Chidambaram -
          608002
        </p>

        <p className="conatcticon">
          <a href="https://github.com/Tech-Club-CSE-FEAT-AU">
            <i className="fa fa-github fa-2x"></i>
          </a>
          <a href="#">
            <i className="fa fa-telegram fa-2x"></i>
          </a>
        </p>
        <div className="footer">
          &copy; 2021 Tech
          Club&nbsp;|&nbsp; All right reserved.
          <br />
          Annamalai University
        </div>
      </Element>
    </div>
  );
};

export default ContactContainer;
